import React from "react";
import Background from "./img/background.jpg";
import NavBar from "./navbar";
import issues from "./data";
import api from "./api";

class Home extends React.Component {
    constructor(props) {
        super(props);

        this.handleClick = this.handleClick.bind(this);
    }

    handleClick(event) {
        if(event.target.value === 'register'){
            this.props.history.push('/register');
        }
        if(event.target.value === 'overview'){
            this.props.history.push('/overview')
        }
    }

    setLocalStorage(){
        if(!localStorage.getItem("issues")){
            localStorage.setItem('issues', JSON.stringify(issues));
            localStorage.setItem('loggedInAs', "GOA");
            const authorities = localStorage.getItem("loggedInAs")+':Authority:'+localStorage.getItem("loggedInAs");
            api.run("lines", authorities, null, null);
        }
    }

    render() {
        return (
            <div>
                {this.setLocalStorage()}
                <img id="background" src={ Background } alt="" />
                <NavBar />
                <div className="register_box" id="small">
                    <br></br>
                    <br></br>
                    <div className="justify-content-center">
                        <button onClick={this.handleClick} type="button" value="register" className="btn btn-primary btn-lg btn-block">Ny melding</button>;
                        <button onClick={this.handleClick} type="button" value="overview" className="btn btn-primary btn-lg btn-block">Aktive meldinger</button>
                    </div>
                    <br></br>
                </div>

                <input className="flatpickr flatpickr-input active" type="text" placeholder="Select Date.."
                       readOnly="readonly" />
            </div>
        );
    }
}
$( '.flatpickr' ).flatpickr({
    noCalendar: true,
    enableTime: true,
    dateFormat: 'h:i K'
});



export default Home;
